import React from 'react';
import { FaBeer} from 'react-icons/fa';

function Nav() {
  return (
    <div className='navbar'>
      <ul>
        <li><FaBeer/></li>
        <li>About</li>
        <li>Contact</li>
      </ul>
      <div className="blog">Blog</div>
    </div>
  )
}

export default Nav
